import React, { Component } from 'react';
import './homepage.styles.css';
 
import Home from '../../pages/homepage.component';
import Features from '../../features.component/features.component';
import About from '../../about.component/about.component';
import RFID from '../../RFID.component/rfid.component';
import Customised from '../../customised.component/customised.component';
import MobileApp from '../../mobile.component/mobile.component';
import WeOffer from '../../weOffer.component/weOffer.component';

class homepage extends Component {
  
  render() {
    return ( 
      
          <div className="bgHomeimg text-white hearderset">
            <h2>WELCOME TO RETAILCLICK ONLINE </h2>
            <h3>Smart people choose RetailClick</h3>
            <Home></Home>
       <Features></Features>
       <About></About>
       <RFID></RFID>
       <Customised></Customised>
       <MobileApp></MobileApp>
       <WeOffer></WeOffer>
          </div>

      
     
    );
  }
}

export default homepage;
